,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-05 01:23:03','2014-02-05 01:23:03','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(10,'edb12341029c07b7ed849063a2942f45','Melissa Mullen','Mejamu@juno.com',6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-05 16:04:33','2014-02-05 16:04:33','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(11,'9c66e62d2c171b4c7275cddd892a4ed3','Darrik Acre','piedmontnaz@att.net',6,1,'Darrik Acre',50,'Quizmaster','I cannot remember what years I have seen Melissa quiz master at which events, so I did not mark many of them.\r\nI do know that Melissa has been a Quizmaster in a variety of Regional tournaments, at the South Central Region\'s Extravaganza event, and at Q events in the past.\r\nShe is a quality and experienced quizmaster.','4 - Meets or exceeds most expectations','Consistent, well-paced question reader.','4 - Meets or exceeds most expectations','Hard to sway her rulings once made because she deliberates very carefully before making a ruling.\r\n','4 - Meets or exceeds most expectations','Melissa coaches at her local church and has a pretty thorough knowledge of the material.','4 - Meets or exceeds most expectations','As a former quizzer and long time quiz leader, Melissa has a excellent knowledge of the rules.','Regional Director','2014-02-05 16:04:34','2014-02-05 16:20:29','--- \n- Regional Invitational (Experienced)\n','District Experienced','Well','Well','Well',''),(12,'f3f8b7c6f2f19440e8916254b328927d','Jan Shoopman','janmshoopman@gmail.com',7,1,'Jan Shoopman',62,'Quizmaster','','4 - Meets or exceeds most expectations','Very rarely hesitates.  Very clear when pre-announcing and reading questions.  Consistent in stopping as soon as the tone sounds.','4 - Meets or exceeds most expectations','I have never seen him show any bias in any round I have watched.  He keeps his emotions neutral.  He does not seem to show frustration or change his demeanor when pressed for time.','4 - Meets or exceeds most expectations','Is very knowledgeable of content, but does not hesitate to confer with content judge, if needed.  Appears to have an equal ratio of accepted/denied challenges.  Does not show preference to either acceptance or denial.','4 - Meets or exceeds most expectations','Has a very thorough knowledge of rules and abides by them without hesitation.  Handles difficult questions/answers, appeals, ties and other things calmly and efficiently.','District Director','2014-02-06 16:18:53','2014-02-10 20:44:35','--- \n- 2011 - Southeast USA Regional Event\n- 2012 - Southeast USA Regional Event\n- 2013 - Southeast USA Regional Event\n- District Invitational (Novice)\n- District Invitational (Experienced)\n','Regional','Matt likes to have a good rapport with those he comes into contact with.  This good rapport in turn earns him a level of respect in the quiz round.  He handles all contact professionally, with a side of fun.  He encourages all those he comes into contact with.  May appear to be \'short\' to those who have not \'learned\' him yet, but quickly dispels that.','If a \'personal\' conflict arises (such as with a coach/quizzer), he tries to distance himself from the issue as to not exacerbate the issue.  In \'professional\' conflict, he maintains composure and continues on, willing to discuss the issue after a round.','Matt is a very confident quizmaster, both in knowledge of the content and understanding of quizzing rules.  His judgments are generally quick and concise, but he will confer with his content judge if there is a question or doubt.  Also uses content judge effectively during challenges/appeals.','While I have not witnessed him at every event that I know he has been involved in (previous Qs, St. Louis invitational, etc), I know that Matt has a love and passion for Bible Quizzing.  He would be a great asset to any tournament.'),(13,'07fc284df89274e7d8c17966a56876be','Matt Thrasher','matt.thrasher@jefferson.kyschools.us',7,1,'Matt Thrasher',62,'Quizmaster','I see myself officiate every time I Quizmaster----you have seen me too, Todd.','4 - Meets or exceeds most expectations','Fairly consistent--always pauses where ever there is punctuation---even on verses.','4 - Meets or exceeds most expectations','Knows material well, when in doubt, uses the content judge for other points of view.','4 - Meets or exceeds most expectations','Very few challenges are accepted--usually original ruling has been thought out clearly with feedback of content judge.  Challenges have to bring to light something that the QM and CJ had not thought of, or be very persuasive regarding why the original ruling should be reversed.','5 - Exceeds expectations','Has been on the rules committee in past years.','Regional Director','2014-02-06 16:18:54','2014-02-07 00:14:40','--- \n- 2008 - St. Louis Top Ten All-Star Quiz\n- 2009 - St. Louis Top Ten All-Star Quiz\n- 2010 - Q2010 - MVNU\n- 2010 - St. Louis Top Ten All-Star Quiz\n- 2011 - St. Louis Top Ten All-Star Quiz\n- 2012 - Q2014 - ONU\n- 2013 - St. Louis Top Ten All-Star Quiz\n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Novice)\n- Regional Invitational (Experienced)\n','District Experienced','Keeps quizzes moving along----not much time for chit chat in between questions.  Lovable person.','There is no such thing as conflict.  Handles situations that can be dealt with in the quiz area, and if persons are still unsatisfied, directs them to those who can deal with issues.  However, in issues within the individual quiz rounds, the Quiz Master has the final say over any matter within that round.','To double check accuracy of all quotations and memory verses, all According to questions, any time a multiple is given as well as any time there is just a question about whether the quizzer has totally answered the question correctly.','Todd should not have moved back to Wisconsin.  Ricky Dean misses him so much.  Since Todd moved to Wisconsin, Kentucky has had more snow than Wisconsin.'),(14,'206e911ab18e0bbe2eb931748843ecbe','Mary Beckworth','mbeckworth@springtownisd.net',8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-07 18:51:57','2014-02-07 18:51:57','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(15,'92d41ec73627dea47e2b93301685e042','Darrik Acre','piedmontnaz@att.net',8,1,'Darrik Acre',50,'Quizmaster','I have seen Mark serve as a quizmaster at a variety of events but am uncertain of dates.','4 - Meets or exceeds most expectations','Mark reads questions well.','4 - Meets or exceeds most expectations','Mark is consistent.','4 - Meets or exceeds most expectations','Mark is an experienced quizmaster.','4 - Meets or exceeds most expectations','Mark is an experienced quizmaster.','Regional Director','2014-02-07 18:51:58','2014-02-10 16:06:09','--- \n- 2012 - South Central USA Regional Event\n- Regional Invitational (Novice)\n- Regional Invitational (Experienced)\n','District Experienced','Mark interacts with everyone around him well.','Good.','Good.',''),(16,'827be04c2ddc08f6f661f19c9d23e8a8','James Moots','trajam@zoominternet.net',9,1,'James Moots',25,'Quizmaster','I have observed Jeremy at both the district and regional level.  I have also interacted with him at district quizzes.  ','5 - Exceeds expectations','Jeremy has an excellent cadence as a quizmaster.   He is very consistent in reading questions and stopping.   He has very good enunciation.','4 - Meets or exceeds most expectations','Jeremy does well in his rulings.  ','5 - Exceeds expectations','Jeremy seems to have a better than average knowledge of the rules and quiz procedures.   ','5 - Exceeds expectations','I have no issues placing Jeremy in varsity.  He can handle multiple questions, etc. ','District Director','2014-02-09 13:57:59','2014-02-21 02:34:25','--- \n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Novice)\n','District Experienced','Jeremy is always a pleasure to interact with.  He helps with any assignment I give him and provides helpful feedback about the day.  He seems to interact in a friendly way with quizzers and coaches.','Jeremy adapts to the different circumstances happening at a quiz.  He can speed up if things fall behind (for reasons outside his control).','I have not seen this extensively but do know that Jeremy used his content judge quite a bit when he had one.','I have only know Jeremy since Q2012 and more so in the last year so I have not known him a long time.   However, he has been a pleasure to have on our district and is a good quizmaster.   My impression is that he could handle and would probably be better suited to the higher levels of quizzing at Q.'),(17,'e67d2dfa3894302ac3fb52023a588017','Matt and Melissa Mosher','steelersmom8@aol.com, pastormattmoser@gmail.com',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-09 13:58:00','2014-02-09 13:58:00','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(18,'c7bd92b582029d7091777e2d356bc798','Taryn Williams','tmew83@hotmail.com',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-10 18:13:20','2014-02-10 18:13:20','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(19,'9a568e44e118773b5d120ee3cec1a0f3','Martha Baker','marthabaker1040@gmail.com',11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-11 23:51:31','2014-02-11 23:51:31','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(20,'d7f01ffc192ffbaa20bbbce8c937a566','Bill Horning','horningwlh@gmail.com',11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-11 23:51:32','2014-02-11 23:51:32','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(21,'a2bbd27802d9beabd04cd957260b473a','James Hodge','jthomasbiz@yahoo.com',12,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-13 03:21:31','2014-02-13 03:21:31','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(22,'b50b885490124342b7ac494440bee1e2','Matt Thrasher','matt.thrasher@jefferson.kyschools.us',12,1,'Matt Thrasher',62,'Content Judge','I never have observed her.  I know her and I know she has been at St. Louis and past Q events, but I cannot give a valid rating for her.','0 - Do not know person or choose not to recommend','Have not observed her.','0 - Do not know person or choose not to recommend','Have not observed her.','0 - Do not know person or choose not to recommend','Have not observed her.','0 - Do not know person or choose not to recommend','Have not observed her.','Regional Director','2014-02-13 03:21:32','2014-02-13 13:29:14','--- \n- 2012 - Q2014 - ONU\n','District Experienced','Have not observed her.','Have not observed her.','Have not observed her.',''),(23,'b58e17069c014166d46fe7a88c98191c','Scott & Sara Christensen','CCDQUIZ@yahoo.com',13,1,'Scott & Sara Christensen',4,'Quizmaster','typically scott officiates while i coach our local team at tournaments (rogers, olathe, quizfest, sterling, michigan, indy)','4 - Meets or exceeds most expectations','Scott is very consistent in his reading and stops well','4 - Meets or exceeds most expectations','scott is willing to listen to challenges/appeals, utilize content judge and rules as well as scriptural context to rule.  He always takes time to listen, and does not hurry through rounds to get done.','4 - Meets or exceeds most expectations','uses content judge especially on specialty and challenges/appeals\r\n','5 - Exceeds expectations','scott has a good working knowledge of the rules','District Director','2014-02-16 23:00:44','2014-02-19 18:45:00','--- \n- 2008 - Q2008 - NNU\n- 2010 - Q2010 - MVNU\n- 2012 - Q2014 - ONU\n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','Regional','scott interacts with everyone in a cheerful positive manner','scott is pretty mild mannered and adapts to change easily.  he also is willing to take time after rounds to explain heated rulings.  ','well.  on specialty, and challenge/appeal specifically',''),(24,'bd74ad75ccbade6f37ea929af91e99d0','Bill Horning','horningwlh@gmail.com',13,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-16 23:00:45','2014-02-16 23:00:45','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(25,'a6abd1c718f31e15902b60c4818e31c7','Becky Seville','creedlily@yahoo.com',14,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-18 04:57:45','2014-02-18 04:57:45','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(26,'995dd97147c5351f2a9f3e42fd533783','Darrik Acre','piedmontnaz@att.net',14,1,'Darrik Acre',50,'Quizmaster','I have seen Stan serve as a Quizmaster at a variety of events: Invitationals, District Quizzes, Regional Events, Q Events, and St. Louis Top Ten Quizzes; though I am not sure of dates because he sometimes coaches at these events as well. ','4 - Meets or exceeds most expectations','Stan reads questions well.','4 - Meets or exceeds most expectations','Stan has an extensive history in Teen Bible Quizzing as both a coach and official.  His rulings reflect that experience and consistency.','4 - Meets or exceeds most expectations','Stan serves as a coach at his local church and is well acquainted with Romans and James.','5 - Exceeds expectations','No one knows quizzing better than Stan.','Regional Director','2014-02-18 04:57:46','2014-02-18 16:12:48','--- \n- 2013 - South Central USA Regional Event\n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Novice)\n- Regional Invitational (Experienced)\n','District Experienced','Stan interacts with others well.','Stan may not always be happy about conflicts/changes, but he adapts well and moves forward.','Because of his experience, Stan is sometimes left without a content judge at quiz events; but utilizes well the content judges assistance when one is available.',''),(27,'12b5cb5a386f36fca6bc8e0a27f9fbeb','James Moots','trajam@zoominternet.net',15,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-21 02:39:43','2014-02-21 02:39:43','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(28,'73970a5941a6d492737363c0ed215b93','Matt and Melissa Mosher','steelersmom8@aol.com, pastormattmoser@gmail.com',15,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-21 02:39:44','2014-02-21 02:39:44','--- []\n\n',NULL,NULL,NULL,NULL,NULL);
