INSERT INTO `pages` VALUES (1,'Basic Information','Basic Information','','<h1>Q2014</h1>\r\n<p>June 30th - July 5th, 2014 on the campus of Trevecca Nazarene University in Nashville, TN.</p>\r\n<p>Hope to see you there!</p>\r\n<p>Officials, register your interest <a title=\"Q2014 Officials Page\" href=\"/officials/new\" target=\"_blank\">here</a>. &nbsp;(Only register at one of these two links, not both)</p>\r\n<p>Volunteers, register your interest <a title=\"Q2014 Volunteer Registration Interest\" href=\"http://www.quizstuff.com/Q2014volunteer.php\" target=\"_blank\">here</a>. (Only register at one of these two links, not both)</p>\r\n<p>USA/Canada NYI</p>',1,1,'2014-01-29 00:15:05','2014-01-30 19:25:57'),(2,'Officials and Volunteer Registration','Officials and Volunteer Registration','','<h1>Q2014</h1>\r\n<p>June 30th - July 5th, 2014 on the campus of Trevecca Nazarene University in Nashville, TN.</p>\r\n<p>Hope to see you there!</p>\r\n<p>Officials, register your interest&nbsp;<a title=\"Q2014 Officials Page\" href=\"/officials/new\" target=\"_blank\">here</a>. &nbsp;(Only register at one of these two links, not both)</p>\r\n<p>Volunteers, register your interest&nbsp;<a title=\"Q2014 Volunteer Registration Interest\" href=\"http://www.quizstuff.com/Q2014volunteer.php\" target=\"_blank\">here</a>. (Only register at one of these two links, not both)</p>\r\n<p>USA/Canada NYI</p>',1,1,'2014-01-30 19:27:14','2014-01-30 19:27:14'),(3,'Home','Home','','<h1>Welcome to Q2014.org!</h1>\r\n<p>Intereseted Officials and Volunteers, click the Officials and Volunteer Registration link above to begin the process of registration for Q2014. &nbsp;Please note that until you receive verification and a special link for final registration, this is just your interest in being involved.</p>\r\n<p><span style=\"font-size: 1.17em;\">Basic Registration Costs (the new registration site is being tested and will be ready soon)</span></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Individuals</strong></span></p>\r\n<table border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>Quizzer</td>\r\n<td>$180</td>\r\n</tr>\r\n<tr>\r\n<td>Coach</td>\r\n<td>$180</td>\r\n</tr>\r\n<tr>\r\n<td>Official</td>\r\n<td>$110</td>\r\n<td>(a special registration code will be emailed after pre-registration is completed &amp; approved)</td>\r\n</tr>\r\n<tr>\r\n<td>Volunteer</td>\r\n<td>$110</td>\r\n<td>(a special registration code will be emailed after pre-registration is completed &amp; approved)</td>\r\n</tr>\r\n<tr>\r\n<td>Guests</td>\r\n<td>$165</td>\r\n<td>(all on campus registration)</td>\r\n</tr>\r\n<tr>\r\n<td>Guests</td>\r\n<td>$10</td>\r\n<td>(off campus and children 3 and under $5)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"text-decoration: underline;\"><strong>Teams</strong></span></p>\r\n<table border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>District</td>\r\n<td>$150</td>\r\n<td>Either division; Experienced or Novice</td>\r\n</tr>\r\n<tr>\r\n<td>Local</td>\r\n<td>$100</td>\r\n<td>Either division; Experienced or Novice</td>\r\n</tr>\r\n<tr>\r\n<td>Regional</td>\r\n<td></td>\r\n<td>See your Regional Director for information-A &amp; B Division</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>More specific cost information to follow soon.</p>\r\n<p>USA/Canada NYI</p>',1,0,'2014-01-30 22:54:53','2014-01-31 21:03:11');
/*!40000 ALTER TABLE `pages` ENABLE KEYS */;
UNLOCK TABLES;

